description:
Six Little McGhees&quot; follows the inspirational lives of Mia and Rozonno McGhee as they juggle marriage, a family business, and six adorable toddlers! High school sweethearts who banded together to rise above their impoverished roots, Mia and Ro never imagined that theywould be blessed with Columbus, Ohio's first sextuplets. Together, with an unconventional army of volunteers, they prove that with a lot of love and a little support, anyone can beat the odds. From sun up to sun down, cameras document each busy day as the McGhees navigate life with six babies and a small entourage of helpers. And with the terrible two's fast approaching, the trouble has just begun.
